	(1, '2023-12-02 05:35:46.000000', 5, NULL, 'GIÀY THỂ THAO ĐẸP DÀNH NAM\n\n  \n\nGiày thể thao, giày sneakers là xu hướng thời trang không thể thiếu đối với mỗi người kể cả nam hay nữ. Các chàng và nàng nên sở hữu ít nhất cho mình một đôi giày. Nó giúp chúng ta thêm tự tin và phong cách hơn bao giờ hết.\n\n  \n\nGIÀY SNEAKERS ĐEN CÁ TÍNH\n\n  \n\nXu hướng thời trang hiện nay, Giày Sneakers hiện đang có rất nhiều kiểu giày thấp cổ cho bạn lựa chọn, song song với việc có nhiều mẫu mã đẹp thì việc mix đồ với giày thấp cổ cũng thật là khó khăn phải không nào các chàng ? Nhưng không cần quá lo lắng hãy cùng theo chân của SHOP để thêm tự tin hơn với phong cách mới trong năm nay.\n\n  \n\nGIÀY THỂ THAO THẤP CỔ TRẺ TRUNG PHONG CÁCH\n\nĐây là hình ảnh của mẫu giày mới nhất, với chất liệu vải mang lại cảm giác thoải mái cho đôi chân , kết hợp cùng kiểu dáng hiện đại, cùng đường may tỉ mỉ, đế giày bền chắc sẽ là 1 lựa chọn tuyệt vời cho bạn.\n\n*   Giày sneakers trẻ trung trong các hoạt động thường ngày như đi học, đi chơi đến lịch lãm khi đi làm. Một đôi giày khiến cho bạn luôn tự tin trong mọi môi trường.\n\n  \n\n\\*Hướng dẫn bảo quản giày:\n\n• Cất giữ sản phẩm ở nơi thoáng mát để giữ gìn chất lượng của sản phẩm ở mức tốt nhất.\n\n• Lau chùi sản phẩm thường xuyên để tránh bụi.\n\n• Bạn sử dụng các loại xà bông, nước rửa chén, kem cạo râu để giặt.\n\n• Chú ý là nên dùng bàn chải mềm hoặc khăn mềm để chà giặt sẽ tốt hơn cho đôi giày của bạn.\n\n• Nên phơi đôi giày trong mát, không nên phơi trực tiếp dưới ánh nắng mặt trời.\n\n\\*Cam kết của shop:\n\n*   HIỂU ĐƯỢC TÂM LÍ KHI MUA HÀNG ONLINE SHOP CAM KẾT\n*   Cam kết sản phẩm giống ảnh 100%\n*   Nhận hàng và thanh toán tại nhà\n*   Hỗ trợ đổi trả hàng nhanh chóng, thuận tiện nhất', 33, 'http://localhost:8000/api/file/2482d0b9-408b-48fa-a050-7876be65879fsp6.png', 0, 'GIÀY SNEAKERS NAM  X86WN21XV', 2000000, 'GIAY-SNEAKERS-NAM-X86WN21XV', 0, 39),
	(3, '2023-12-02 05:35:53.000000', 4.33333, NULL, 'Chào mừng đến với cửa hàng của chúng tôi!\n\nChúng tôi sẽ giao hàng trong vòng 48 giờ.\n\nHàng hóa có xuất xứ từ Trung Quốc, sản phẩm của chúng tôi là nhà máy bán hàng trực tiếp, giá rẻ và kiểm soát chất lượng tốt.\n\n  \n\n1.Tất cả các sản phẩm là ảnh chụp thực tế, đủ hàng tồn kho, xin vui lòng yên tâm để đặt hàng.\n\n  \n\n1.  Chúng tôi sử dụng cm (cm) làm đơn vị đo lườn\n\nHướng dẫn đo lường\n------------------', 30, 'http://localhost:8000/api/file/30d434d6-53cc-419d-a621-a3af195fd7b3sp7.png', 1, 'Giày thể thao nữ dày đế thoáng khí MS0722', 2000000, 'Giay-the-thao-nu-day-đe-thoang-khi-MS0722', 0, 39),
	(4, '2023-12-02 05:35:57.000000', 5, NULL, 'CAM KẾT:\n\n✔️ Hoàn tiền 100% nếu nhận sản phẩm không giống hình. Tất cả các sản phẩm đăng bán đều được shop chụp hình và quay video bằng điện thoại để các bạn xem rõ chất liệu giày trước khi đặt mua (100% ảnh thật)\n\n✔️ Đổi ngay hàng mới nếu nhận hàng bị lỗi, hỏng từ phía nhà sản xuất. Hỗ trợ đổi size nếu các bạn đi không vừa.\n\n✔️ FreeShip đổi trả toàn quốc.\n\nLưu ý: Liên lạc ngay với chúng tôi ngay sau khi nhận hàng.\n\n\\[HÌNH ẢNH và MÔ TẢ\\]\n\n✔️ 100% ảnh, video thật được chúng tôi quay và chụp bằng điện thoại cá nhân\n\n✔️ Kiểu dáng hot trend của năm nay và còn kéo dài trong những năm tiếp theo. Đế giày được thiết kế chịu ma sát tốt, tăng chiều cao, nhẹ, êm, cân bằng và thoáng khí\n\n✔️ Giày đẹp, nhẹ, bền. Giá phải chăng phù hợp với các bạn học sinh, sinh viên. Có thể làm giày đôi, giày nhóm. Thích hợp đi chơi, du lịch, chạy bộ, gym, đi học, đi làm...\n\n✔️ Dễ phối đồ, có thể kết hợp với váy, jeans, sooc…. Phù hợp với mọi thời tiết từ đông sang hè.\n-----------------------------------------------------------------------------------------------', 22, 'http://localhost:8000/api/file/4686135d-6701-42fd-b249-c18251b3be48sp45.png', 0, 'Giày Thể Thao Adidas 4D Fusio FY5928', 3000000, 'Giay-The-Thao-Adidas-4D-Fusio-FY5928', 0, 42),
