	(85, '2023-12-02 05:40:28.000000', 5, NULL, 'HƯỚNG DẪN SỬ DỤNG\n\nKhông dùng hóa chất hay bột giặt có hoạt tính tẩy rửa mạnh\n\nKhông dùng bàn chải cứng để vệ sinh giày sẽ làm hư\n\nKhông đi mưa ngâm nước lâu, không phơi giày trực tiếp dưới ngoài trời nắng gắt\n\nVới các sàn phẩm sáng màu, nên vệ sinh thường xuyên\n\nTránh cất giữ giày khi còn ướt, ẩm..\n\nMô tả chi tiết:\n\nSize: 36-43\n\nGiày đầy đủ phụ kiện (hộp, giấy gói, giấy tờ, tất tặng kèm) được đóng gói cẩn thận.\n\nChất liệu: da thật 100%, da nhăn mềm mại không bám bẩn rất dễ vệ sinh.\n\nĐế: Đế đúc liền khối phần dưới có các đường họa tiết (chống trơn trượt) và in logo thương hiệu giày.\n\nForm: Form dáng chuẩn 1:1 , được gia công tỉ mỉ tạo độ hài hòa giữa phần thân và phần đế\n\nGiày hot trend, kiểu dáng đẹp sang chảnh dễ phối đồ có thể mang đi chơi, đi học dự tiệc , đi làm...\n\n\\* BẢO HÀNH\n\n\\- Trong 30 ngày kể từ khi nhận được sản phẩm\n\n\\- Nếu sản phẩm sai mẫu mã, bị lỗi..., quý khách sẽ được miễn phí hoàn toàn cước đổi trả sản phẩm khác.\n\n\\- Quý khách được đổi với sản phẩm mới ngang hoặc cao giá hơn\n\n\\- 1 sản phẩm, chỉ được đổi trả 1 lần duy nhất.', 40, 'http://localhost:8000/api/file/6ccf330b-39ec-470b-89e3-129498ac5b17sp16.png', 2, 'Nike Air Force 1 Shadow', 5000000, 'Nike-Air-Force-1-Shadow', 0, 40),
	(86, '2023-12-02 05:40:34.000000', 5, NULL, 'Giày Convers 1970s Trắng Cổ Cao Nam, Nữ - Snesker Convers Cao Cấp Full Box I245 Iggy Sneaker\n\nMô Tả Sản Phẩm\n\nForm giày Converse 1970s được thiết kế chuẩn hơn với gót giày và mũi giày ôm sát vào chân nhưng không gây cảm giác khó chịu cho người mang. Đường viền đen quanh đế nổi lên trên nền trắng ngà tạo sự bắt mắt, điểm nhấn cho đôi giày. Đường kim mũi chỉ quanh thân giày được gia công tỉ mỉ tạo nên sự tinh tế, nổi bật cho đôi giày và mẫu giầy converse 1970s chưa bao giờ là hết HOT, luôn luôn được các bạn trẻ săn đón nhiều nhất\n\n  \n\nThông Tin\n\nMẫu Giày : Cổ Cao, Cổ Thấp\n\nMàu Sắc : Trắng, Đen\n\nKích Thước : 36 đến 43\n\n  \n\nHướng Dẫn Bảo Quản Giày\n\nBảo quản nơi khô thoáng\n\nTránh ngâm nước quá lâu\n\nKhông sử dụng nước tẩy hoặc bột giặt có nhiều chất tẩy\n\nSử dụng loại xi phù hợp với màu sắc, chất liệu da\n\nKhông phơi sản phẩm trực tiếp dưới ánh sáng mặt trời\n\nKhông nên gặt bằng bột giặt, giày trắng lên sử dụng chai giặt giày khô\n\n  \n\nCam Kết\n\nSản phẩm giống như hình\n\nShop chuyên về giầy converse nên giá cả so với thị trường cũng rất hợp lý\n\nShop Luôn hỗ trợ khách hàng chu đáo, cố gắng trả lời hết những thắc mắc xoay quanh sản phẩm giày CV 1970s ạ\n\nThời gian chuẩn bị: Giày có sẵn, thời gian chuẩn bị hàng và gửi hàng nhanh nhất\n\nChính sách đổi hàng miễn phí khi giày không giống hình, nhầm mẫu, số lượng, giày converse cổ thấp bị lỗi\n--------------------------------------------------------------------------------------------------------', 36, 'http://localhost:8000/api/file/c99d8b3b-d97f-474f-9894-1fcc70f7cf52sp6.png', 2, 'Converse RunStar Legacy CX', 4000000, 'Converse-RunStar-Legacy-CX', 0, 43),
