	(89, '2023-12-02 05:40:39.000000', 5, NULL, 'Converse x Fear of God ESSENTIALS Chuck 70 High-top mùa hè năm nay vẫn sở hữu những yếu tố cơ bản của silhouette này nhưng điểm khác chính là họ đã dùng bản cải tiến của Chuck 70-2020. Việc đó đồng nghĩa chúng sẽ sở hữu chất liệu/công nghệ cho upper, insole, outsole và cả dây giày cao cấp hơn, nét hơn, êm hơn so với đợt trước đó.\n\n  \n\nVà những thiết kế tưởng chừng như cơ bản đó đã tạo nên cực phẩm Converse x Fear of God ESSENTIALS Chuck 70 High-top. Chúng cũng đã sở hữu được một vị trí quan trọng trong giới Streetwear từ lúc bắt đầu đến giờ ở Việt Nam nói riêng và quốc tế nói chung.\n------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------', 20, 'http://localhost:8000/api/file/f3c0d3fd-61ac-45c4-9573-3be4f2e9a27dSP3.png', 2, 'Converse 1970s', 4000000, 'Converse-1970s', 0, 43),
