	(101, '2023-12-02 05:41:02.000000', 4.66667, NULL, 'Giày Adidas chính hãng \\[AUTHENTIC 100%\\]\n\nGiày Adidas được làm từ chất liệu cao cấp, bền đẹp trong suốt quá trình sử dụng. Đế thể thao êm ái giúp bạn luôn cảm thấy thoải mái dù có di chuyển cả ngày dài. Logo Adidas đặt tinh tế trên đôi giày tạo điểm nhấn nổi bật.\n\nForm giày thể thao Adidas lên chân vừa vặn, các đường chỉ khâu vô cùng chắc chắn và tỉ mỉ đảm bảo hài lòng mọi khách hàng. Màu sắc xinh xắn cực ngọt dễ dàng kết hợp nhiều trang phục khác nhau theo sở thích tạo nên 1 set đồ đẹp dễ thương khi đi chơi, đi học hay dạo phố.\n\n  \n\n——————\n\nSHOP CAM KẾT:\n\n\\- Cam kết 100% sản phẩm đều là HÀNG CHÍNH HÃNG/AUTHENTIC, full tem, tag...\n\n\\- Đa dạng mẫu mã và giá SALES tốt nhất thị trường\n\n\\- Sản phẩm được chụp ảnh và quay video thật, cam kết đúng chất liệu, hình dáng như hình.\n\n——————\n\nQUYỀN LỢI KHÁCH HÀNG:\n\n\\- Hàng Full tem, tag, giấy gói chính hãng\n\n\\- Giá SALES rẻ nhất thị trường, nhiều ưu đãi, quà tặng kèm\n\n\\- Dịch vụ tốt nhất, giao hàng nhanh, tư vấn nhiệt tình\n\n\\- Hỗ trợ đổi size trong vòng 03 ngày kể từ ngày nhận hàng (phí khách chịu)\n---------------------------------------------------------------------------', 24, 'http://localhost:8000/api/file/26b16c71-cd32-4f3d-b486-8b9671a3fce2SP15.png', 2, 'Adidas Ultra Boost', 3000000, 'Adidas-Ultra-Boost', 0, 42),
