	(110, '2023-12-02 05:41:24.000000', 4, NULL, 'Nơi sản xuất: Hàng sản xuất ở nước thứ 3 tùy từng lô hàng (Việt Nam, Trung Quốc, Ấn Độ, Campuchia...)\n\n  \n\nHướng dẫn bảo quản:\n\n• Hạn chế không nên để sản phẩm tiếp xúc nhiều với chất bẩn, đặc biệt là các chất bẩn cứng đầu như máu, cà phê, nhựa trái cây…\n\n• Bảo quản sản phẩm ở nơi khô ráo, thoáng mát… để tránh các loại nấm mốc. (Nếu không sử dụng thường xuyên thì nên bỏ vào bao ni lông bịt kín hoặc hộp đựng.)\n\n• Nên sử dụng khuôn hoặc nhét giấy báo cũ vào bên trong để luôn giữ được hình dạng ban đầu (đối với sản phẩm giày dép)\n\n• Không nên phơi sản phẩm dưới nắng quá gắt.\n\n  \n\nChính sách đổi trả: Áp dụng theo chính sách của sàn\n\n  \n\nChính sách bảo hành: Không bảo hành\n\n  \n\nXuất xứ thương hiệu: Mỹ\n-----------------------', 29, 'http://localhost:8000/api/file/022be901-f825-493e-ae70-2df23eb4d42csp12.png', 0, 'Adidas Stan Smith', 3000000, 'Adidas-Stan-Smith', 0, 42),
