	(114, '2023-12-02 05:41:34.000000', 4.33333, NULL, 'Nơi sản xuất: Hàng sản xuất ở nước thứ 3 tùy từng lô hàng (Việt Nam, Trung Quốc, Ấn Độ, Campuchia...)\n\n  \n\nHướng dẫn bảo quản:\n\n• Hạn chế không nên để sản phẩm tiếp xúc nhiều với chất bẩn, đặc biệt là các chất bẩn cứng đầu như máu, cà phê, nhựa trái cây…\n\n• Bảo quản sản phẩm ở nơi khô ráo, thoáng mát… để tránh các loại nấm mốc. (Nếu không sử dụng thường xuyên thì nên bỏ vào bao ni lông bịt kín hoặc hộp đựng.)\n\n• Nên sử dụng khuôn hoặc nhét giấy báo cũ vào bên trong để luôn giữ được hình dạng ban đầu (đối với sản phẩm giày dép)\n\n• Không nên phơi sản phẩm dưới nắng quá gắt.\n\n  \n\nChính sách đổi trả: Áp dụng theo chính sách của sàn\n\n  \n\nChính sách bảo hành: Không bảo hành\n\n  \n\nXuất xứ thương hiệu: Mỹ\n-----------------------', 15, 'http://localhost:8000/api/file/cb153416-4663-42e0-8bec-914d340df976sp4.png', 2, 'Nike Zoom N979 Đen Ghi Nhạt SF', 3000000, 'Nike-Zoom-N979-Đen-Ghi-Nhat-SF', 0, 40),
	(115, '2023-12-02 05:41:37.000000', 3, NULL, 'Thực tế, Converse All-Court là một dòng giày mới của Converse, được biết đến với vẻ ngoài hiện đại, đậm chất sporty, là một đối thủ đáng gờm trong làng giày Converse thể thao vốn đang rất sôi động.\n\n  \n\n![Trẻ trung và tràn đầy năng lượng với những mẫu giày Converse thể thao](https://drake.vn/image/catalog/H%C3%ACnh%20content/gi%C3%A0y-converse-th%E1%BB%83-thao/giay-converse-the-thao-08.jpg)\n\nVới đặc tính dễ mang, dễ mặc và vẻ ngoài toát lên chất casual style, đôi giày được ưa chuộng bởi các bạn trẻ năng động, tự tin thể hiện bản thân mình. Form dáng vừa vặn ôm lấy bàn chân, không quá cồng kềnh cũng không quá hầm hố, vừa đủ để bảo vệ đôi chân khi tham gia thể thao và thuận tiện cho các hoạt động khác.\n\n  \n\n![Trẻ trung và tràn đầy năng lượng với những mẫu giày Converse thể thao](https://drake.vn/image/catalog/H%C3%ACnh%20content/gi%C3%A0y-converse-th%E1%BB%83-thao/giay-converse-the-thao-07.jpg)\n\nTừng chi tiết đều được chăm chút tỉ mỉ, sử dụng chất liệu cao cấp và áp dụng công nghệ tối tân nhất. BST Converse All-Court mới gồm hai mẫu giày màu trắng và đen cực basic, cho bạn thoải mái thể hiện khả năng sáng tạo trong việc mix-match hàng ngày.\n\n  \n\n![Trẻ trung và tràn đầy năng lượng với những mẫu giày Converse thể thao](https://drake.vn/image/catalog/H%C3%ACnh%20content/gi%C3%A0y-converse-th%E1%BB%83-thao/giay-converse-the-thao-09.jpg)\n\n  \n\n  \n\n  \n\n---', 40, 'http://localhost:8000/api/file/2faf7348-ab0f-4811-8610-33c983e1c797sp2.png', 2, 'Giày Converse All-Court', 5000000, 'Giay-Converse-All-Court', 0, 43),
	(116, '2023-12-02 05:41:41.000000', 5, NULL, 'Xuất hiện vào năm 1976, Pro Leather được biết đến là dòng giày dành cho môn bóng rổ. Đúng như tên gọi của nó, đôi giày này sử dụng da cao cấp làm chất liệu chủ đạo. Các vận động viên lúc bấy giờ rất ưa thích loại giày này bởi thiết kế ôm chân cùng với độ thoải mái tuyệt đối nhờ áp dụng công nghệ tiên tiến.\n\n  \n\n![Trẻ trung và tràn đầy năng lượng với những mẫu giày Converse thể thao](https://drake.vn/image/catalog/H%C3%ACnh%20content/gi%C3%A0y-converse-th%E1%BB%83-thao/giay-converse-the-thao-01.jpg)\n\n  \n\n_Nguồn ảnh: sưu tầm_\n\nĐiểm nhấn của đôi giày này là logo Star Chevron đặc trưng gây ấn tượng mạnh, khác hẳn với logo của các dòng All Star thường thấy của [Converse](https://drake.vn/converse). Các nhà thiết kế thường ứng dụng nhiều màu sắc khác nhau cho logo này ở mỗi Pack.\n\n  \n\n![Trẻ trung và tràn đầy năng lượng với những mẫu giày Converse thể thao](https://drake.vn/image/catalog/H%C3%ACnh%20content/gi%C3%A0y-converse-th%E1%BB%83-thao/giay-converse-the-thao-02.jpg)\n\n  \n\n_Nguồn ảnh: sưu tầm_\n\nTrải qua một thời gian làm mưa làm gió trên thị trường, trong thời kì khó khăn của Converse, mẫu giày này dường như “ngủ yên” và tạm bị quên lãng. Những năm gần đây, Converse đã mang trở lại những BST Pro Leather mới, khơi dậy sức sống và làm mới một dòng giày đã không còn xuất hiện trên thị trường trong vài thập kỷ. Có thể nói, lần trở lại này vô cùng ngoạn mục, làm sống dậy quá khứ huy hoàng của dòng Pro Leather và mang đến cho công chúng một sự lựa chọn không thể chất hơn.\n\n  \n\n![Trẻ trung và tràn đầy năng lượng với những mẫu giày Converse thể thao](https://drake.vn/image/catalog/H%C3%ACnh%20content/gi%C3%A0y-converse-th%E1%BB%83-thao/giay-converse-the-thao-04.jpg)\n\n  \n\n_Nguồn ảnh: sưu tầm_\n\nBST Converse Pro Leather mới được thiết kế với nhiều phiên bản, mang nhiều gam màu độc đáo khác nhau, cho bạn thoải mái lựa chọn. Phong cách thể thao năng động là điều bạn có thể tìm thấy ở một dòng giày chuyên dành cho môn bóng rổ. Đừng bỏ qua cơ hội sở hữu mẫu giày Converse thể thao đẹp – bền – tiện nghi này nhé.', 25, 'http://localhost:8000/api/file/8e60972e-beab-4459-b37f-e4a2221aad0asp1.png', 0, 'Giày Converse thể thao – Pro Leather', 2000000, 'Giay-Converse-the-thao–Pro-Leather', 0, 43),
	(117, '2023-12-02 05:41:45.372000', 0, NULL, 'adidas Yeezy từ khi xuất hiện trên thị trường đã thu hút rất nhiều lượt quan tâm và tìm kiếm của người tiêu dùng, ai cũng muốn sở hữu riêng cho mình một đôi. Với thiết kế thời thượng cùng đa dạng phối màu rất chất, sẽ rất thích hợp để bạn diện những trang phục với phong cách hiện đại và cá tính.\n\nBên cạnh đó, đây là đôi giày được thiết kế vô cùng êm ái cho bàn chân của người sử dụng. Đảm bảo độ thông thoáng, chắc chắn và đàn hồi tốt để bạn có được những bước chân thoải mái nhất.\n\n  \n\n---', 25, 'http://localhost:8000/api/file/7452ceeb-2b62-4294-b679-fd554d818b57SP10.png', 0, 'adidas Yeezy', 3000000, 'shorts-the-thao-7', 0, 42),
	(118, '2023-12-02 05:41:49.762000', 0, NULL, 'adidas Alphabounce có thiết kế vô cùng mạnh mẽ, cá tính và trẻ trung thu hút được sự ưa chuộng của rất nhiều người tiêu dùng. Phù hợp với nhiều loại trang phục hoạt động thường ngày, mang đến cho bạn vẻ ngoài chỉnh chu và tự tin nhất.\n\nPhần thân giày sử dụng chất liệu vải Forged Mesh cùng cấu trúc sock-line và dây giày tròn có tác dụng ôm khít chân. Điều này sẽ giúp tăng độ thoáng khí và mang đến cảm giác khỏe khoắn khi hoạt động. Phần đế được làm chắc chắn với độ bám dính và chống trơn trượt vô cùng tốt, mang đến cảm giác êm ái cho đôi chân.\n\n  \n\n---', 30, 'http://localhost:8000/api/file/79709aa2-1a9a-4124-a52e-74f60403e1d5sp9.png', 2, 'adidas Alphabounce', 4000000, 'adidas-Alphabounce', 0, 42),
	(119, '2023-12-02 05:41:53.000000', 4, NULL, 'Dòng sản phẩm này của thương hiệu adidas có khá nhiều màu sắc cho bạn lựa chọn. Thiết kế đơn giản nhưng vô cùng thời thượng sẽ giúp mang đến cho các bạn nam lẫn bạn nữ một vẻ ngoài năng động, tự tin.\n\nGiày với độ đàn hồi và co giãn tốt giúp mang đến cho bạn cảm giác êm ái khi vận động. Là đôi giày rất phù hợp để bạn có thể tham gia các môn thể thao như chạy bộ hay [tập gym](https://misskick.vn/gym-la-gi-x-loi-ich-cua-tap-gym-ma-ban-nen-biet). Với vẻ ngoài hiện đại bạn còn thể diện để đi học, đi làm, đi chơi,\n\n  \n\n---', 10, 'http://localhost:8000/api/file/d570d857-4dc0-47a0-a61a-9afaa12e7a05sp8.png', 1, 'adidas Supernova', 2000000, 'adidas-Supernova', 0, 42),
	(120, '2023-12-02 05:41:56.775000', 0, NULL, 'adidas Galaxy cũng là một trong những dòng giày của hãng được nhiều người yêu thích và tin tưởng lựa chọn. Giày có thiết kế năng động, trẻ trung phù hợp với các bạn trẻ cá tính. Bạn có thể phối đôi giày này với những outfit khỏe khoắn đậm chất streetwear khi đi chơi cùng bạn bè.\n\nĐặc trưng bởi sự mềm mại, êm ái và thấm hút mồ hôi tốt nên luôn mang đến cảm giác thoải mái cho người sử dụng. Bạn có thể vô tư vận động, tham gia các môn thể thao mà mình yêu thích. Với phần đế chống trơn trượt còn giúp bảo vệ đôi chân của bạn khỏi những chấn thương.\n\n  \n\n---', 30, 'http://localhost:8000/api/file/5ed14a95-00ef-4284-b828-9637ae6939e5sp7.png', 0, 'adidas Galaxy', 5000000, 'adidas-Galaxy', 0, 42),
	(121, '2023-12-02 05:41:59.163000', 0, NULL, 'Đây là một trong những mẫu giày đã tạo nên tiếng vang trong sự nghiệp phát triển của thương hiệu adidas. Được rất nhiều tín đồ thời trang lựa chọn từ khi vừa mới ra mắt. Là siêu phẩm của giới [giày chạy bộ](https://misskick.vn/top-5-mau-giay-chay-bo-gia-re-chat-luong-tot-nhat), vừa có ngoại hình thu hút vừa có thể đảm bảo mang đến sự an toàn và thoải mái cho đôi chân.\n\n[adidas Ultraboost](https://misskick.vn/giay-ultra-boost-la-gi-co-nen-mua-adidas-ultra) có thiết kế hiện đại, mạnh mẽ và khỏe khoắn. Tuy trong khá đơn giản nhưng lại vô cùng được lòng người tiêu dùng. Bạn có thể luyện tập thể thao trên đôi giày này, đồng thời cũng có thể mang như một đôi giày thời trang phối cùng với những outfit cực chất để dạo phố hay đi bất cứ đâu mà bạn muốn.\n\n  \n\n---', 20, 'http://localhost:8000/api/file/6ba0ee27-67a4-4c0e-b077-006353f41992sp6.png', 2, 'adidas Ultraboost', 3000000, 'adidas-Ultraboost', 0, 42),
	(122, '2023-12-02 05:42:01.000000', 0, NULL, 'Tại thời điểm mới ra mắt, Adidas Yeezy trở thành một trong các loại giày Adidas “gây sốt” cực mạnh tới các fan sneaker. Mẫu giày này có thiết kế đơn giản, chất vải nhẹ, đế êm, tông màu thời thượng cùng với phong cách street style độc đáo.\n\nRất nhiều người sẵn sàng xếp hàng và thức xuyên đêm tại Trung Tâm Thương Mại của Bitexco để được sở hữu những đôi giày adidas đẹp nhất. Đây cũng là đôi giày khiến streetwear Việt Nam “đứng ngồi không yên” bởi vẻ đẹp của nó.\n\nMẫu giày Adidas Yeezy gồm 3 phiên bản nổi bật, bao gồm: Adidas Yeezy 350 V2, Adidas Yeezy 700, Adidas Yeezy 750.\n\n  \n\n---', 30, 'http://localhost:8000/api/file/0bc50c04-60fb-4e07-8a3f-0d8c95b36ac1sp5.png', 2, 'Adidas Yeezy', 5000000, 'Adidas-Yeezy', 0, 42),
	(123, '2023-12-02 05:42:03.000000', 4, NULL, 'Nike Blazer là đôi giày thể thao có lịch sử lâu đời nhất trong các loại giày Nike. Mặc dù được thiết kế như một đôi giày cổ điển nhưng Nike Blazer lại sở hữu vẻ bề ngoài bắt mắt và tạo được cảm giác thoải mái tột độ đã khiến người dùng đánh giá cao. Bạn có thể mang để tập luyện thể dục, thể thao hay đi dạo phố, đi hẹn hò đều rất tiện. Dù kết hợp với phong cách cổ điển vintage, phong cách thanh lịch cá tính hay phong cách thể thao năng động, thì Nike Blazer vẫn giúp bạn tạo nên thần thái ấn tượng và phong cách thời trang khiến người đối diện phải “điên đảo”.\n-----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------', 20, 'http://localhost:8000/api/file/3e782d87-870c-446e-9ce1-765d51976c37sp3_2.png', 0, 'Nike Blazer', 4000000, 'Nike-Blazer', 0, 40),
	(124, '2023-12-02 05:42:06.000000', 5, NULL, '     Trong khi hầu hết mọi người đều nghĩ rằng Nike Dunk là giày trượt băng, thì thực tế nó chính là giày bóng rổ. Đôi giày mang đến phong cách đường phố, sẽ trở nên nổi bật và cuốn hút nếu bạn là người yêu thích xu hướng này. Thiết kế cá tính, bụi bặm giúp bạn dễ dàng phối cùng nhiều phong cách khác nhau. Nike Dunk có giá dao động 4 – 10 triệu đồng, thậm chí có những phiên bản lên tới vài chục triệu đồng. Không kể đến đôi giày đấu giá khác hoặc những bản đặc biệt dành riêng cho các vận động viên thì Nike Dunk có thể được coi là đôi giày đắt nhất mọi thời đại. Với dòng giày Nike Dunk bạn nên linh hoạt lựa chọn đi True to size hoặc tăng thêm một nửa size để có được những trải nghiệm tuyệt vời nhất nhé.\n--------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------', 20, 'http://localhost:8000/api/file/22ba30a4-bd02-4b7d-90ea-1f672b65329dsp3.png', 1, 'Nike Dunk', 2000000, 'Nike-Dunk', 0, 40),
	(128, '2023-12-02 05:42:10.000000', 4, NULL, 'Kích cỡ bạn đo đc căn cứ theo kích cỡ bàn chân là size chuẩn hay thường gọi là truesize. Nike Air Force 1 Low được thiết kế từ lưới và da cao cấp, form giày vừa vặn nên bạn có thể downsize 0.5 – 1 để giày không bị quá rộng. Ngược lại, với mẫu giày Nike Air Force 1 hightop và mid thì bạn nên chọn true size để chân được tạo cảm giác thoải mái và không bị quá ôm hay quá rộng. Là kiểu dáng cực kì dễ phối đồ, phù hợp với mọi hoàn cảnh, mọi outfit nên việc mix đồ với giày AF1 cũng trở nên dễ dàng cho cả nam và nữ. Chỉ cần biến tấu chút thôi thì tổng quan trang phục của bạn đã vô cùng khác lạ rồi đấy.', 30, 'http://localhost:8000/api/file/187b0865-e171-46c9-be94-4f374127c9942d96db6e-5931-4aef-abbe-008c803b108bsp1_mauden.png', 2, 'Nike Air Force 1', 3000000, 'Nike-Air-Force-1', 0, 40),
	(131, '2023-12-02 05:42:19.842000', 0, NULL, 'SHOP CAM KẾT\n\n\\- Về sản phẩm Hàng thật 100% như hình, video.\n\n\\- Về giá cả: Đảm bảo giá tốt nhất so với các sản phẩm có chất lượng tương tự\n\n\\- Về dịch vụ: Luôn hỗ trợ khách hàng chu đáo, cố gắng trả lời hết những thắc mắc xoay quanh sản phẩm giày trắng ạ\n\n\\- Thời gian chuẩn bị: Giày có sẵn, thời gian chuẩn bị hàng và gửi hàng nhanh nhất\n\n\\- Chính sách đổi trả miễn phí khi giày không giống hình, nhầm mẫu, số lượng, giày thể thao nam nữ bị lỗi\n\nLỜI NHẮC\n\nSau khi nhận giày xong nếu có vấn đề nào bạn chưa vừa lòng làm ơn hãy liên hệ ngay với chúng tôi để được hỗ trợ và giải quyết .các bạn hãy vui lòng dành chút thời gian đánh giá sản phẩm để shop lấy động lực phục vụ các bạn tốt hơn nhé !! Cảm ơn bạn đã quan tâm. Đừng quên theo dõi shop! Bạn sẽ được cập nhật những mẫu giày mới nhất trên thị trường!!!\n--------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------', 30, 'http://localhost:8000/api/file/7e829d7b-6326-4a3e-9d44-f3a83d78de49sp1.png', 1, 'Giày Thể Thao Supreme x Nike Air Max 98 TL SP DR1033-100', 10000000, 'Giay-The-Thao-Supreme-Nike-Air-Max', 0, 40),
	(133, '2023-12-02 05:42:21.630000', 0, NULL, 'Giày Thể Thao Adidas XPLR Black White Màu Đen mặt hàng giày dép thời trang chất lượng chính hãng của thương hiệu Adidas nổi tiếng thế giới, Giày Thể Thao Adidas XPLR Black White Màu Đen đang được giảm giá ưu đãi tại gian hàng Mộc Shoes trên sàn thương mại điện tử\n\n  \n\nVài nét về Giày Thể Thao Adidas XPLR Black White Màu Đen\n\nGiày Thể Thao Adidas XPLR Black White Màu Đen sở hữu kiểu dáng siêu phong cách năng động được đông đảo giới trẻ yêu thích. Với đôi giày thời trang này chắc chắn bạn sẽ trở nên nổi bật và cuốn hút hơn.\n\n  \n\nĐặc điểm nổi bật của giày Adidas XPLR Black White\n\n  \n\n\\- Giày được làm từ chất liệu vải dệt với độ ôm được thiết kế đặc biệt để nâng đỡ có định hướng và hỗ trợ chuyển động.\n\n  \n\n\\- Các đường nét của đôi giày vô cùng tinh tế và sắc sảo.\n\n  \n\n\\- Đế giày bằng cao su mềm nhẹ, có độ bám tốt cùng độ nâng phù hợp giúp đôi chân vững vàng hơn khi di chuyển và hoạt động.\n\n  \n\n\\- Màu sắc trẻ trung dễ dàng kết hợp với nhiều trang phục khác nhau theo sở thích bản thân tạo nên 1 set đồ đẹp khi đi chơi, đi học hay dạo phố,…\n\n  \n\nMẫu giày thật sự phù hợp với các bạn yêu thích thể thao. Bạn có thể mang phối hợp với các chiếc quần short hay chân váy jean (đối với nữ). Hoặc các chiếc quần jeans, áp pull,,,(với nam) đều tạo điểm nhấn mạnh mẽ.\n\n  \n\n\\- Thân giày bằng vải dệt kim\n\n\\- Lớp lót bằng vải lưới\n\n\\- Dải băng 3 Sọc làm từ vải làm dây đai; Gót dày bằng da Nubuck\n\n\\- Tận hưởng sự thoải mái và hiệu quả của miếng lót giày OrthoLite®; Hệ thống dây buộc nhanh gọn\n\n\\- Đế giữa đúc từ chất liệu EVA tạo nên lớp đệm nhẹ\n\n\\- Đế ngoài bằng cao su\n\n\\- Chất liệu chính: Phần thân giày bằng vải dệt và da tổng hợp / Lớp lót bằng vải dệt / Đế ngoài bằng cao su\n\n\\- Màu sản phẩm: Trắng Đen\n\n\\- Mã sản phẩm: CQ2405\n----------------------', 20, 'http://localhost:8000/api/file/2c90e53f-dc5a-4467-b3eb-0dde9247197asp1.png', 0, 'Giày Thể Thao Adidas Grand Court K EG1517', 3000000, 'GiAy-The-Thao-Adidas-Grand-Court-K-EG1517', 0, 42),
	(134, '2023-12-02 05:42:24.000000', 4, NULL, 'Thông tin sản phẩm Giày Jordan Cổ Cao:\n\nChất liệu da : Da sần, da nỉ, da trơn\n\nChất liệu đế : 85% cao su SR, 15% nhựa pp\n\nChất liệu lót : Premium\n\nForm EU : 36,37,38,39,40,41,42,43\n\nChiều cao đế : 2.5cm\n\nKiểu dáng : Cổ thấp, cổ cao\n\nĐặc tính nổi bật của Giày Thể Thao:\n\nKháng nước nhẹ khi đi mưa\n\nĐế và lót được khâu toàn bộ tránh bung keo\n\nNhiều phiên bản màu sắc\n-----------------------', 30, 'http://localhost:8000/api/file/b1d0c8ed-bfa1-4150-a3cb-404745d3cce0sp2.png', 0, 'Giày Thể Thao Nike Air Jordan 1 High OG UNC University', 12000000, 'Giay-The-Thao-Nike-Air-Jordan-1-High-OG-UNC-University', 0, 40),
	(136, '2023-12-02 05:42:29.338000', 0, NULL, 'MÔ TẢ SẢN PHẨM\n\nLƯU Ý : CHÚNG TÔI CHỈ BÁN HÀNG TẠI DUY NHẤT TẠI TRANG WEB NÀY\n\n• MỌI TÀI KHOẢN KHÁC DÙNG ẢNH SP VÀ VIDEO CỦA SHOP ĐỀU LÀ GIẢ MẠO. CHÚNG TÔI CHỈ CHỊU TRÁCH NHIỆM NẾU CÁC BẠN MUA HÀNG TRÊN TÀI KHOẢN SHOPEE NÀY. CẢM ƠN CÁC BẠN ĐÃ ĐỌC !\n\nCAM KẾT:\n\nHoàn tiền 100% nếu nhận sản phẩm không giống hình. Tất cả các sản phẩm đăng bán đều được shop chụp hình và quay video bằng điện thoại để các bạn xem rõ chất liệu giày trước khi đặt mua (100% ảnh thật)\n\nĐổi ngay hàng mới nếu nhận hàng bị lỗi, hỏng từ phía nhà sản xuất. Hỗ trợ đổi size nếu các bạn đi không vừa.\n\nFreeShip đổi trả toàn quốc.\n\nLưu ý: Liên lạc ngay với chúng tôi ngay sau khi nhận hàng.', 40, 'http://localhost:8000/api/file/d4a8b2f7-cb16-4938-9dd8-a8769f0dd20dsp3.png', 2, 'Giày Thể Thao Sneaker Nhiều Màu Sắc GI-000088', 1400000, 'Giay-The-Thao-Sneaker-Nhieu-Mau-Sac', 0, 39),
	(137, '2023-12-02 05:42:31.664000', 0, NULL, 'Giày thể thao nam đế tăng chiều cao LEIF RUNNING mẫu mới năm 2022 kiểu dáng trẻ trung, mạnh mẽ, phong cách Avi430\n\nMã Sản phẩm: 430\n\nĐế giày cao su non cao cấp đi êm chân, chống trơn trượt\n\nLót giày thông hơi, thoáng khí đi cực êm chân\n\nMặt giày: da phối vải\n\nĐủ size Nam: 39 - 44\n\nHàng chất lượng\n\nQuý khách cứ yên tâm , chúng tôi luôn đem đến cho quý khách những sản phẩm chất lượng nhất với giá thành hợp lý nhất .\n\nBảo hành do lỗi sản xuất : 06 Tháng\n\n\\--------------------------------------------------------------------------------------------------------\n\nCam Kết :\n\nHàng thật 100% như hình .\n\nShop luôn có video quay tại kho giày\n\nGiá Siêu cạnh tranh .\n\nNhận hàng hàng TRƯỚC - Thu tiền SAU\n\nGiao hàng Toàn Quốc\n\n\\----------------------------------------------------------------------------------------------------------\n\n\\[HÌNH ẢNH và MÔ TẢ\\]\n\n100% ảnh thật được chúng tôi chụp bằng điện thoại cá nhân\n\nKiểu dáng hot trend của năm nay và còn kéo dài trong những năm tiếp theo. Đế giày được thiết kế chịu ma sát tốt, tăng chiều cao, nhẹ, êm, cân bằng và thoáng khí\n\nGiày đẹp, nhẹ, bền. Giá phải chăng phù hợp với các bạn học sinh, sinh viên. Có thể làm giày đôi, giày nhóm. Thích hợp đi chơi, du lịch, chạy bộ, gym, đi học, đi làm...\n\nDễ phối đồ, có thể kết hợp với váy, jeans, sooc…. Phù hợp với mọi thời tiết từ đông sang hè\n-------------------------------------------------------------------------------------------', 10, 'http://localhost:8000/api/file/69b5a981-89ce-4e77-a0e4-7af9da503725sp4.png', 0, 'Giày thể thao nam đế tăng chiều cao', 1000000, 'Giay-the-thao-nam-đe-tang-chieu-cao', 0, 39),
	(138, '2023-12-02 05:42:32.000000', 4.5, NULL, 'Nike Jordan 1 là 1 items rất dễ phối đồ, dù là bộ suit thanh lịch, hay streetwear năng động, thể thao cũng khiến bạn trông cực kỳ cá tính, trẻ trung. Đối với những cô nàng điệu đà, một chiếc váy body hay áo croptop “tôn eo” kết hợp cùng quần jeans hoặc jogger cũng đủ khiến bạn trở nên vô cùng ấn tượng nổi bật trong mắt bất cứ ai. Chọn Air Jordan 1 vừa vặn với kích cỡ của bàn chân là việc hết sức quan trọng. Những người có bàn chân nhỏ nên giảm nửa cỡ sẽ thoải mái hơn nữa. Những người có bàn chân to nên tăng nửa cỡ để có cảm giác thoải mái hơn khi trải nghiệm.\n-------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------', 30, 'http://localhost:8000/api/file/73f59748-33ac-428c-8948-0fe17ad50eae8e918521-2e8b-4617-8ca9-1a20a7584facsp1_mauxamxanh2.png', 0, 'Nike Jordan 1', 3000000, 'Nike-Jordan-1', 0, 40),
	(139, '2023-12-02 05:42:35.000000', 4.33333, NULL, 'SHOP ĐẢM BẢO và CAM KẾT CHO CÁC BẠN\n\nVề sản phẩm: Shop cam kết cả về chất lượng và kiểu dáng. Tất cả ảnh đều không chỉnh sửa. 99% là sản phẩm đúng như ảnh 1% là do khách hàng quá đẹp trai, hihi.\n\nDịch vụ: Hỗ trợ đổi hàng nếu các bạn đi không vừa.\n\nThời gian chuẩn bị hàng: hàng luôn có sẵn nên cứ đặt là sẽ đóng gói gửi bạn ạ\n\n\\----------------------------------------------\n\nTên sản phẩm: Giày nam \\[FREESHIP EXTRA\\] Giày sneaker nam cổ cao kiểu dáng thể thao, đế êm ái mã JD03 size 39-44\n\n\\-----------------------------------------------\n\nThông tin sản phẩm\n\nThương hiệu: NO BRAND\n\nMã sản phẩm: JD03, JD04\n\nKích thước: 39 40 41 42 43 44\n\nPhong cách: Giày thể thao nam cao cổ, thời trang thích hợp đi chơi, đi học\n\nMàu sắc: Giày nam JD bên mình có phối màu đen trắng và xám xanh trắng\n\nMùa thích hợp: đã là thời trang thì phá tan thời tiết 4 mùa mua nào đi cũng hợp ạ\n\nVới phong cách trẻ trung năng động sản phẩm Giày nam JD các bạn có thể phối với các loại quần: quần bò, quần lửng, quần kaki, quần jogger rất đẹp và ngầu ạ\n\nChất liệu làm nên đôi giày là da PU thoáng không bí chân và vải được dệt may chuẩn xác và được shop cắt chỉ thừa và đóng gói cẩn thận ạ\n\nĐối tượng áp dụng: 1 – 100 tuổi, đam mê là bất tận ạ\n\nĐế giày thể thao nam: làm từ chất liệu cao su non, êm, đàn hồi, bên trong có lót trợ lực rất êm ái và giúp hạn chế mồ hôi tốt.\n\nFreeship/hỗ trợ phí vận chuyển (khách không biết lấy mã miễn phí vận chuyển / inbox cho shop để được hướng dẫn)\n\nKHUYẾN CÁO\n\nVới bất kỳ 1 đôi GIÀY NAM nào bạn đều nên hạn chế để giày bị tiếp xúc trực tiếp với nhiệt độ nóng và ngâm nước mưa lâu khi phơi giày, bạn nên dùng giấy vệ sinh bao bọc bề mặt giày\n-----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------', 30, 'http://localhost:8000/api/file/1a1cf63c-3dc1-4056-956d-c2d83b2f7509sp5.png', 0, 'Giày Nam Sneaker thể thao kiểu dáng đẹp phong cách trẻ trung năng động', 1000000, 'Giay-Nam-Sneaker-the-thao-kieu-dang-dep-phong-cach-tre-trung-nang-đong', 0, 39),
	(140, '2023-12-02 05:42:39.000000', 4, NULL, 'SHOP CAM KẾT HOÀN TIỀN NẾU NHẬN HÀNG KHÔNG GIỐNG ẢNH - LỖI 1 ĐỔI 1 HOẶC MUỐN ĐỔI SIZE GIÀY\n\nBảo hành đổi trà hoàn tiền theo chính sách của shopee trong các trường hợp: lỗi do nhà sản xuất, shop gửi nhầm mẫu, hư hỏng do vận chuyển...\n\nHỗ trợ đổi size cho khách hàng khi giày còn nguyên vẹn.\n\nHƯỚNG DẪN SỬ DỤNG\n\nKhông dùng hóa chất hay bột giặt có hoạt tính tẩy rửa mạnh\n\nKhông dùng bàn chải cứng để vệ sinh giày sẽ làm hư\n\nKhông đi mưa ngâm nước lâu, không phơi giày trực tiếp dưới ngoài trời nắng gắt\n\nVới các sản phẩm sáng màu, nên vệ sinh thường xuyên\n\nTránh cất giữ giày khi còn ướt, ẩm..', 20, 'http://localhost:8000/api/file/b8dc9322-5b27-4347-886e-0991288ff535sp4_1.png', 2, 'Giày thể thao nam nữ Adidas Forum 84', 400000, 'Giay-the-thao-nam-nu-Adidas-Forum-84', 0, 42),
	(141, '2023-12-02 05:42:43.573000', 0, NULL, '\\- Mã Sản Phẩm: MSN2800\n\n\\- Chất lượng tốt nhất trong tầm giá\n\n\\- Form đẹp chuẩn : Màu sắc giống đến 98\n\n\\- Chất liệu da + da lộn + vải mesh\n\n\\- Logo Mông in dập chìm.\n\n\\- Lưỡi gà cao dày dặn; swoosh sắc nét; Mông mũi làm đẹp\n\n\\- Tem QR CODE Có thể check mã 2D\n\n\\- Đế 2 lớp khâu chỉ đều\n\n\\- Full box + accessories', 10, 'http://localhost:8000/api/file/14f1941a-3585-4a0c-8135-16fea42d4065sp3_2.png', 2, 'Giày Sneaker _Nike Air Max 97', 2000000, 'Giay-Sneaker-Nike-Air-Max-97', 0, 40),
	(142, '2023-12-02 05:42:45.000000', 5, NULL, 'Xin chào thân yêu:\n\nChúng tôi cung cấp các sản phẩm tốt nhất với giá thấp nhất.\n\nSản phẩm của chúng tôi được mua từ nước ngoài, và chất lượng sản phẩm của chúng tôi sẽ được kiểm soát chặt chẽ.\n\nNếu hàng hóa bạn nhận được bị lỗi, xin vui lòng liên hệ với chúng tôi ngay lập tức và chúng tôi sẽ làm hài lòng bạn.\n\nNếu bạn hài lòng với sản phẩm của chúng tôi, xin vui lòng cho chúng tôi một nhận xét tích cực (5 sao)\n\nSau khi đơn hàng hoàn tất (bình luận năm sao), bạn có thể nhận được phiếu giảm giá.\n\nTìm nhân viên dịch vụ khách hàng để thu thập nó.\n------------------------------------------------', 41, 'http://localhost:8000/api/file/461288bd-42d8-4134-8806-5719f7495576sp3_1.png', 2, 'Giày Thể Thao adidas supercharged xoboperated game of Thor', 1400000, 'Giay-The-Thao-adidas-supercharged-xoboperated-game-of-Thor', 0, 42),
	(144, '2023-12-02 05:42:51.000000', 4.5, NULL, '  \n\n  \n\nHàng order 10-15 ngày\n\nQuý kháng đặt hàng vui lòng không hủy hàng\n\nHàng chất lượng như hình ảnh\n\nKhông đúng hàng hoàn tiền 100%\n\nĐược kiểm tra hàng trước khi nhận', 30, 'http://localhost:8000/api/file/72b5c47c-79a4-4401-8f93-978f8a6ca9f8sp2.png', 2, 'Giày Air Force 1', 2000000, 'Giay-Air-Force-1', 0, 41),
	(145, '2023-12-02 05:42:54.000000', 4.5, NULL, 'Giày Thể Thao Adidas XPLR Black White Màu Đen mặt hàng giày dép thời trang chất lượng chính hãng của thương hiệu Adidas nổi tiếng thế giới, Giày Thể Thao Adidas XPLR Black White Màu Đen đang được giảm giá ưu đãi tại gian hàng Mộc Shoes trên sàn thương mại điện tử\n\n  \n\nVài nét về Giày Thể Thao Adidas XPLR Black White Màu Đen\n\nGiày Thể Thao Adidas XPLR Black White Màu Đen sở hữu kiểu dáng siêu phong cách năng động được đông đảo giới trẻ yêu thích. Với đôi giày thời trang này chắc chắn bạn sẽ trở nên nổi bật và cuốn hút hơn.\n\n  \n\nĐặc điểm nổi bật của giày Adidas XPLR Black White\n\n  \n\n\\- Giày được làm từ chất liệu vải dệt với độ ôm được thiết kế đặc biệt để nâng đỡ có định hướng và hỗ trợ chuyển động.\n\n  \n\n\\- Các đường nét của đôi giày vô cùng tinh tế và sắc sảo.\n\n  \n\n\\- Đế giày bằng cao su mềm nhẹ, có độ bám tốt cùng độ nâng phù hợp giúp đôi chân vững vàng hơn khi di chuyển và hoạt động.\n\n  \n\n\\- Màu sắc trẻ trung dễ dàng kết hợp với nhiều trang phục khác nhau theo sở thích bản thân tạo nên 1 set đồ đẹp khi đi chơi, đi học hay dạo phố,…\n\n  \n\nMẫu giày thật sự phù hợp với các bạn yêu thích thể thao. Bạn có thể mang phối hợp với các chiếc quần short hay chân váy jean (đối với nữ). Hoặc các chiếc quần jeans, áp pull,,,(với nam) đều tạo điểm nhấn mạnh mẽ.\n\n  \n\n\\- Thân giày bằng vải dệt kim\n\n\\- Lớp lót bằng vải lưới\n\n\\- Dải băng 3 Sọc làm từ vải làm dây đai; Gót dày bằng da Nubuck\n\n\\- Tận hưởng sự thoải mái và hiệu quả của miếng lót giày OrthoLite®; Hệ thống dây buộc nhanh gọn\n\n\\- Đế giữa đúc từ chất liệu EVA tạo nên lớp đệm nhẹ\n\n\\- Đế ngoài bằng cao su\n\n\\- Chất liệu chính: Phần thân giày bằng vải dệt và da tổng hợp / Lớp lót bằng vải dệt / Đế ngoài bằng cao su\n\n\\- Màu sản phẩm: Trắng Đen\n\n\\- Mã sản phẩm: CQ2405\n----------------------', 30, 'http://localhost:8000/api/file/857b0ded-f518-4433-990e-633c89a617b8sp2.png', 2, 'Giày thể thao Sneaker Adidas XPLR - Đen - Panda', 2000000, 'Giay-the-thao-Sneaker-Adidas', 0, 42),
	(146, '2023-12-02 05:42:57.767000', 0, NULL, '– Thiết kế: Độc quyền\n\n– Vật liệu: Cao cấp\n\n– Gia công: Tỉ mỉ\n\n\\_ Hoạt động: tập thể thao, đi dạo, picnic.\n\n\\_ Giới tính: Nam.\n\n\\*Khẳng định giá trị khi sử dụng các sản phẩm [giày thể thao](https://trivela.vn/collection/product/giay-the-thao-c7042) chính hãng\n-----------------------------------------------------------------------------------------------------------------------------------', 13, 'http://localhost:8000/api/file/e0cb283e-0a25-4760-892b-311126f26d22sp1.png', 0, 'Giày Jordan 1', 159000, 'tanktop-the-thao-active-v2', 0, 39),
